function Users(props) {
    let usersElements = props.users.map(ue => <div> key={ue.id} name={ue.name}  location = {ue.location} descriptionProfile={ue.descriptionProfile} </div>)
    return(
        <div>
            {usersElements}
        </div>
    )
}

export default Users;
